import React from "react";

import Header from "../Header";
import Footer from "../Footer";

function UsersList() {

  const users = []

  let rows = [
    { name: "Pablo", surname: "Gomes" },
    { name: "Joao", surname: "Silva" },
    { name: "Maria", surname: "Souza" },
    { name: "Pedro", surname: "Matias" },
  ];


  return (
    <>
      <Header />
      <table style="width:100%">
      <tr>
      <th>Nome</th>
      <th>Sobrenome</th>
    </tr>
  </table>
      <Footer />
    </>
  );
}

export default UsersList;
